window.bookSummaryJSON = "Witty Wodehousesï¿½s best-loved creation is the master-servant team of Bertie Wooster, the charming nitwit, and Jeeves, his effortlessly superior valet and protector. <i>Newsweek</i> says \"they are at their best in <i>The Code of the Woosters</i>.\" This installment involves Gussie Fink-Nottle, the soupey Madeline Bassett, old Pop Bassett, the unscrupulous Stiffy Byng, the Rev. H.P. (\"Stinker\") Pinker, an eighteenth-century cow-creamer, and a liberal dose of the imperious Aunt Dahlia. There you have it: jolly good fun and grins galore! Jeeves once more to the rescue!"; 
